inline double
fastncdf_pos(double const x, bool const precise_tail) noexcept {
    if(x >= fastncdf_max){
        if(precise_tail){
            double p, cp;
            p = x;
            Rf_pnorm_both(x, &p, &cp, 0L, 0L);
            return p;
        } else
            return 1.0;
    }

    const int i = static_cast<int>(x * fastncdf_hinv);
    const double w = (x - fastncdf_x[i]) * fastncdf_hinv;
    return w * fastncdf_y[i + 1] + (1.0 - w) * fastncdf_y[i];
}
